Protect.defaultProps = {
  blur: false,
  boxTitle: 'This page is password protected.',
  inputPlaceholder: 'Password',
  buttonLabel: 'Submit',
  styles: {
    input: {},
    button: {},
    header: {},
    wrapper: {}
